import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService.js";

const TableRow = ({ data }) => (
	<tr>
		<td key={data.title}>{data.title}</td>
		<td key={data.Genre}>{data.Genre}</td>
		<td key={data.Stock}>{data.Stock}</td>
		<td key={data.Rate}>{data.Rate}</td>
	</tr>
);

class Movies extends Component {
	state = {
		movies: getMovies()
	};

	render() {
		let data = this.state.movies;
		return (
			<React.Fragment>
				<table className='table'>
					<thead>
						<tr>
							<th>Title</th>
							<th>Genre</th>
							<th>Stock</th>
							<th>Rate</th>
						</tr>
					</thead>
					<tbody>
						{data.map((movie) => {
							<tr>
								<td></td>
								<td></td>
								<td></td>
								<td></td>
							</tr>;
						})}
					</tbody>
				</table>
			</React.Fragment>
		);
	}
}

export default Movies;
